            * REPLACE (
                ARRAY(
                SELECT AS STRUCT
                    * REPLACE (
                      udf_aggregate_json_sum(value) AS value,
                      udf_get_bucket_range(bucket_range) AS bucket_range,
                      udf_get_histogram_type(bucket_range) AS metric_type
                    )
                FROM
                    UNNEST(histogram_aggregates)
                ) AS histogram_aggregates
            )
        FROM
            aggregated
